import React, { Component } from 'react';

class VideoItem extends Component {
  constructor(props) {
    super(props);
    this.state = {};
  }

  render() {
    const { video } = this.props;
    return <div>Video Item: {video.div}</div>;
  }
}

export default VideoItem;
